public class MinimumWindowSubstring_76 {

	int min = Integer.MAX_VALUE;
	int start = 0;

	static String ans = "";

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		String s = "";
		String t = "";

		MinimumWindowSubstring_76 o = new MinimumWindowSubstring_76();
//		o.minWindow(s, t);
		System.out.println("ans: " + ans);

//		s = "ADOBECODEBANC";
//		t = "ABC";
		String res = o.minWindowTwoPointer(s, t);
		System.out.println("res: " + res);
	}

	public String minWindowTwoPointer(String s, String t) {
		if (s.length() < t.length()) {
			return "";
		}

		HashMap<Character, Integer> freq = new HashMap<>();
		for (char c : t.toCharArray()) {
			freq.put(c, freq.getOrDefault(c, 0) + 1);
		}

		int left = 0;
		int right = 0;

		int windowSize = 0;
		String ans = "";
		int min = Integer.MAX_VALUE;

		int charsRemaining = t.length();

		HashMap<Character, Integer> currRequiredFreq = new HashMap<>(freq);
		HashMap<Character, Integer> currWindowCharCounts = new HashMap<>();

		while (right <= s.length()) {

			if (charsRemaining != 0) {
				if (right == s.length()) {
					break;
				}
				char c = s.charAt(right);
				currWindowCharCounts.put(c, currWindowCharCounts.getOrDefault(c, 0) + 1);
				right++;
				if (currRequiredFreq.containsKey(c) && currRequiredFreq.get(c) != 0) {
					currRequiredFreq.put(c, currRequiredFreq.get(c) - 1);
					charsRemaining--;
				}
			} else {
				windowSize = right - left;
				if (windowSize < min) {
					min = windowSize;
					ans = s.substring(left, right);
				}

				while (left < right && charsRemaining == 0) {
					char c = s.charAt(left);
					left++;
					currWindowCharCounts.put(c, currWindowCharCounts.getOrDefault(c, 0) - 1);
					if (freq.containsKey(c) && currWindowCharCounts.get(c) < freq.get(c)) {
						charsRemaining++;
						currRequiredFreq.put(c, currRequiredFreq.get(c) + 1);
					} else {
						windowSize = right - left;
						if (windowSize < min) {
							min = windowSize;
							ans = s.substring(left, right);
						}
					}
				}
				if (right == s.length()) {
					break;
				}

			}
		}
		return ans;
	}

	public String minWindowIterative(String s, String t) {

		// this iterative solution also works fine... 265/266 tc passed
		if (s.length() < t.length()) {
			return "";
		}

		int min = Integer.MAX_VALUE;
		int start = 0;

		String ans = "";

		HashMap<Character, Integer> freq = new HashMap<>();
		for (char c : t.toCharArray()) {
			freq.put(c, freq.getOrDefault(c, 0) + 1);
		}

		HashMap<Character, Integer> freq1 = new HashMap<>(freq);
		for (int i = 0; i <= s.length() - t.length(); i++) {

			if (freq1.containsKey(s.charAt(i)) && freq1.get(s.charAt(i)) != 0) {
				start = i;
				int charsRemaining = t.length();
				int count = 0;
				for (int j = start; j <= s.length(); j++) {
					if (charsRemaining == 0) {
						if (count < min) {
							min = count;
							ans = s.substring(start, j);
						}
						break;
					}

					if (j < s.length()) {
						char c = s.charAt(j);
						if (freq1.containsKey(c) && freq1.get(c) != 0) {
							freq1.put(c, freq1.get(c) - 1);
							charsRemaining--;
						}
						count++;
					}
				}

				freq1 = new HashMap<>(freq);
			}
		}
		return ans;
	}

	public String minWindow(String s, String t) {

		// using this logic, 265/266 test cases passed. Only 1 failed due to time limit,
		// hence logic is correct but needs optimisation
		if (s.length() < t.length()) {
			return "";
		}

		int charsRemaining = t.length();
		HashMap<Character, Integer> freq = new HashMap<>();
		for (char c : t.toCharArray()) {
			freq.put(c, freq.getOrDefault(c, 0) + 1);
		}

		for (int i = 0; i <= s.length() - t.length(); i++) {
			if (freq.containsKey(s.charAt(i)) && freq.get(s.charAt(i)) != 0) {
				start = i;
				find(s, i, freq, charsRemaining, 0);
			}
		}

		return ans;
	}

	void find(String s, int index, HashMap<Character, Integer> freq, int charsRemaining, int count) {
		if (charsRemaining == 0) {
			if (count < min) {
				min = count;
				ans = s.substring(start, index);
			}
			return;
		}

		if (index == s.length()) {
			return;
		}
		char c = s.charAt(index);

		if (freq.containsKey(c) && freq.get(c) != 0) {
			freq.put(c, freq.get(c) - 1);
			// charsRemaining--;
			// count++;
			find(s, index + 1, freq, charsRemaining - 1, count + 1);
			freq.put(c, freq.get(c) + 1);
		} else {
			find(s, index + 1, freq, charsRemaining, count + 1);
		}
	}

}
